import './TopNav.css';

function TopNavBtn({text, icon}) {
    return (
        <button className="top-nav-btn">
            <svg style={{width:"20", height:"20"}}>
                {icon}
            </svg>
            <div>
                {text}
            </div>
        </button>
    );
};

export default TopNavBtn;
